const getLetter = (letter) => {
  let color = "rgb(175, 220, 215)";
  let fill = "rgb(0, 30, 61)";
  if (typeof letter !== "string") {
    throw new Error("Letter must be string.");
  }

  if (letter.length !== 1) {
    throw new Error("Letter must be a single Character");
  }
  const regex = /^[a-z]$/i;
  if (!regex.test(letter)) {
    throw new Error("Letter must be a between a-z.");
  }

  return `<div class="letters_letterWrap"><svg xmlns="http://www.w3.org/2000/svg" width="50" height="50" viewBox="0 0 50 50" style="color: ${color}; fill: ${fill};">${letters[
    `get${letter.toUpperCase()}`
  ]()}</svg></div>`;
};
$(document).ready(function () {
  // Bind keyup event to the input field
  $(".text-input").on("focus", function (e) {
    // Code to execute when input field gains focus
    $(".text-input-area label").hide();
  });

  $(".text-input").on("blur", function (e) {
    // Code to execute when input field loses focus
    if ($(this).val() === "") {
      $(".text-input-area label").show();
    }
  });

  $(".text-input").on("keydown", function (event) {
    const inputVal = $(this).val();
    // Handle backspace key
    if (event.keyCode === 8) {
      $(this).val(inputVal.substring(0, inputVal.length - 1));
      $(
        ".letters-top .letters_letterWrap:last, .letters-bottom .letters_letterWrap:last"
      ).remove();
      event.preventDefault();
      return;
    }

    // Test for alphabetic characters with a maximum length of 3
    if (inputVal.length >= 3 || !/^[a-zA-Z]$/.test(event.key)) {
      event.preventDefault();
      return;
    }

    // Append new letter to letters_letters
    console.log(event.key);
    $(".letters_letters").append(getLetter(event.key));
  });

  //   if (!$(".text-input").val()) {
  //      $(".letters_letters").append(getLetter("E"));
  //      $(".letters_letters").append(getLetter("L"));
  //      $(".letters_letters").append(getLetter("L"));
  //   }
});

$(function () {
  var TxtType = function (el, toRotate, period) {
    this.toRotate = toRotate;
    this.el = el;
    this.loopNum = 0;
    this.period = parseInt(period, 10) || 2000;
    this.txt = "";
    this.tick();
    this.isDeleting = false;
  };

  TxtType.prototype.tick = function () {
    var i = this.loopNum % this.toRotate.length;
    var fullTxt = this.toRotate[i];

    if (this.isDeleting) {
      this.txt = fullTxt.substring(0, this.txt.length - 1);
    } else {
      this.txt = fullTxt.substring(0, this.txt.length + 1);
    }

    this.el.innerHTML = '<span class="wrap">' + this.txt + "</span>";

    var that = this;
    var delta = 200 - Math.random() * 100;

    if (this.isDeleting) {
      delta /= 2;
    }

    if (!this.isDeleting && this.txt === fullTxt) {
      delta = this.period;
      this.isDeleting = true;
    } else if (this.isDeleting && this.txt === "") {
      this.isDeleting = false;
      this.loopNum++;
      delta = 500;
    }

    setTimeout(function () {
      that.tick();
    }, delta);
  };

  window.onload = function () {
    var elements = document.getElementsByClassName("typewrite");
    for (var i = 0; i < elements.length; i++) {
      var toRotate = elements[i].getAttribute("data-type");
      var period = elements[i].getAttribute("data-period");
      if (toRotate) {
        new TxtType(elements[i], JSON.parse(toRotate), period);
      }
    }
    // INJECT CSS
    var css = document.createElement("style");
    css.type = "text/css";
    css.innerHTML = ".typewrite > .wrap { border-right: 0.02em solid #141414}";
    document.body.appendChild(css);
  };
});
